import './App.css';
import { useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState({username:'', password: ''});
  const [home, setHome] = useState('');

  function handleClick(){
    fetch("/homePage")
      .then((res) => setHome(res))

  }

  useEffect(() => {
    fetch("/login")
      .then((res) => res.json())
      .then((data) => setData({username: data.username, password: data.password}));
  }, []);

  console.log(data);

  return (
    <div className="App">
      <header className="App-header">
        <p>UserName: {!data ? "Loading..." : data.username}</p>
        <p>Password: {!data ? "Loading..." : data.password}</p>
        <button onClick={handleClick}>Home page</button>
      </header>
    </div>
  );
}

export default App;
